script: |
  super -f text -I q7865.spq | sort > q7865.out

inputs:
  - name: q7865.spq
    data: |
      SELECT - COUNT ( * ) * - + COUNT ( * ) * - ( + MAX ( + - col2 ) ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + 34 IN ( + col0 - + ( + 65 ), + 5, - col1 + + col2 * col2, - 45 + + + col1, + + col2 );
  - name: tab0

outputs:
  - name: q7865.out
    data: |
      90
